export class Anime{
  private id: number;
  private nome: string;
  private ano: number;
  private quantidadeDeTemporadas: number;

  constructor(id: number, nome: string, ano: number, quantidadeDeTemporadas: number){
    this.id = id;
    this.nome = nome;
    this.ano = ano;
    this.quantidadeDeTemporadas = quantidadeDeTemporadas;
  }
}
